import React from 'react';
import {
    HashRouter,
    Route,
    Switch,
    Redirect    
} from 'react-router-dom';

import Layout from './Layout/Layout';


const App = () => {
    
    const PrivateRoute = ({args,...rest}) => {
        return <Route 
                    path="/app"
                    component= {() =>  <Redirect to="/app/dashboard/" />} 
                />
    }

    return (
        <HashRouter>
            <Switch>
                <Route path="/" exact  component={() => <Redirect to="/app/dashboard" /> } />
                <Route path="/app" exact component={() => <Redirect to="/app/dashboard" /> } />
                <PrivateRoute path="/app/dashboard" component={Layout} />
            </Switch>
        </HashRouter>
    )

}


export default App;
